-- 임시 테이블을 제거하고 최종 VIEW 구조를 생성
DROP TABLE IF EXISTS `cum_business`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `cum_business` AS select `business`.`id` AS `id`,`business`.`mid_addr` AS `mid_addr`,`business`.`permissionDate` AS `permissionDate`,`business`.`permiCnt` AS `permiCnt`,`business`.`closeCnt` AS `closeCnt`,`business`.`operaCnt` AS `operaCnt`,sum(`business`.`permiCnt`) OVER (PARTITION BY `business`.`mid_addr` ORDER BY `business`.`id` desc )  AS `cum_permiCnt`,sum(`business`.`closeCnt`) OVER (PARTITION BY `business`.`mid_addr` ORDER BY `business`.`id` desc )  AS `cum_closeCnt`,sum(`business`.`operaCnt`) OVER (PARTITION BY `business`.`mid_addr` ORDER BY `business`.`id` desc )  AS `cum_operaCnt` from `business` group by `business`.`id`,`business`.`mid_addr`,`business`.`permissionDate` order by `business`.`mid_addr`,`business`.`permissionDate` desc;

-- 임시 테이블을 제거하고 최종 VIEW 구조를 생성
DROP TABLE IF EXISTS `cum_business_addr`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `cum_business_addr` AS select (case when (`b`.`dt` between '2009' and '2014') then '과거' when (`b`.`dt` between '2018' and '2023') then '최근' end) AS `시점`,`b`.`dt` AS `dt`,`b`.`mid_addr` AS `mid_addr`,`b`.`sum_` AS `sum_`,`b`.`avg_` AS `avg_` from (select substr(`a`.`permissionDate`,1,4) AS `dt`,`a`.`mid_addr` AS `mid_addr`,sum(`a`.`cum_operaCnt`) AS `sum_`,avg(`a`.`cum_operaCnt`) AS `avg_` from (select `business`.`id` AS `id`,`business`.`mid_addr` AS `mid_addr`,`business`.`permissionDate` AS `permissionDate`,sum(`business`.`operaCnt`) OVER (PARTITION BY `business`.`mid_addr` ORDER BY `business`.`id` desc )  AS `cum_operaCnt` from `business` group by `business`.`id`,`business`.`mid_addr`,`business`.`permissionDate` order by `business`.`mid_addr`,`business`.`permissionDate` desc) `a` group by substr(`a`.`permissionDate`,1,4),`a`.`mid_addr` having ((`dt` between '2018' and '2023') or (`dt` between '2009' and '2014'))) `b`;

-- 임시 테이블을 제거하고 최종 VIEW 구조를 생성
DROP TABLE IF EXISTS `cum_business_all`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `cum_business_all` AS select `a`.`dates` AS `dates`,`a`.`permiCnt` AS `permiCnt`,`a`.`closeCnt` AS `closeCnt`,`a`.`operaCnt` AS `operaCnt`,sum(`a`.`permiCnt`) OVER (ORDER BY `a`.`dates` )  AS `cum_permiCnt`,sum(`a`.`closeCnt`) OVER (ORDER BY `a`.`dates` )  AS `cum_closeCnt`,sum(`a`.`operaCnt`) OVER (ORDER BY `a`.`dates` )  AS `cum_operaCnt` from (select `business`.`permissionDate` AS `dates`,sum(`business`.`permiCnt`) AS `permiCnt`,sum(`business`.`closeCnt`) AS `closeCnt`,sum(`business`.`operaCnt`) AS `operaCnt` from `business` group by `business`.`permissionDate`) `a`;

